const BearContainer = (props) => {

  return (
    <div className="upper symbol-box">
      <h2 id="symbol">{props.downerStocks.name}</h2>
      <p className="price">Price: ${props.downerStocks.price}</p>
      <div className="changes-row">
        <p className="">${props.downerStocks.percentage}%</p>
        <img id="downArrow" src="./images/downArrow.svg" />
        <p>${props.downerStocks.change}</p>
      </div>
    </div>
  );
};

export default BearContainer;
